import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getVideogames } from "../../REDUX/actions";
import Paginado from "../../COMPONENTS/Paginado/Paginado";
import Card from "../../COMPONENTS/Card/Card";
import style from "./home.module.css";
import {Link} from "react-router-dom";

const Home =()=>{
    const videogames = useSelector(state=>state.videogames)
    const dispatch =useDispatch();
    const [currentPage, setCurrentPage]=useState(1)
    const [videogamesPage, setVideogamesPage]=useState(15)
    const indexOfLastVideogame=currentPage * videogamesPage
    const indexOfFirstVideogame=indexOfLastVideogame - videogamesPage
    const currentVideogames= videogames.slice(indexOfFirstVideogame, indexOfLastVideogame);
    const paginado =(pageNumber)=>{
        setCurrentPage(pageNumber)
    }
    useEffect(()=>{
        dispatch(getVideogames());
    },[])
    const handleOnClick =(e)=>{
        e.preventDefault();
        dispatch(getVideogames());
    }
    return (
        <div>
        <h1>Videogames</h1>
        <div>
        <button onClick={e=>{handleOnClick(e)}}>Cargar videogames</button>
        </div>
        <select>
            <option value="asc">Ascendente</option>
            <option value="desc">Descendente</option>
            <option value="desc rating">Mayor rating</option>
            <option value="asc rating">Menor rating</option>
        </select>
        <select>
            <option value="All">TODOS</option>
            <option value="Action">Action</option>
            <option value="Indie">Indie</option>
            <option value="Adventure">Adventure</option>
            <option value="RPG">RPG</option>
            <option value="Strategy">Strategy</option>
            <option value="Shooter">Shooter</option>
            <option value="Casual">Casual</option>
            <option value="Simulation">Simulation</option>
            <option value="Puzzle">Puzzle</option>
            <option value="Arcade">Arcade</option>
            <option value="PLatformer">PLatformer</option>
            <option value="Racing">Racing</option>
            <option value="Massively Multiplayer">Massively Multiplayer</option>
            <option value="Sports">Sports</option>
            <option value="Fighting">Fighting</option>
            <option value="Family">Family</option>
            <option value="Board Games">Board Games</option>
            <option value="Educational">Educational</option>
            <option value="Card">Card</option>
        </select>
        <Paginado videogamesPage={videogamesPage}
        videogames={videogames.length}
        paginado ={paginado}/>
        <div >
            {currentVideogames?.map((videogame)=>{
                return (
                <div className={style.container}>
                <Link to={"/home"+videogame.id}>
                <Card
                key={videogame.id}
                name={videogame.name}
                background_image={videogame.background_image}
                genres={videogame.genres}
                />
                </Link>
                </div>)
            })}
        </div>
        </div>
    )

}


export default Home;
